import React from "react";
import { Routes, Route, NavLink} from "react-router-dom";
import Login from "./Login/LoginPage";
// import Inicio from "./inicio/inicio";

const RoutesComponent = () => {
  return (
    <Routes>
      {/* Rutas */}
      <Route path="/" element={<Login />} /> {/* Login como ruta principal */}
      {/* <Route path="/inicio" element={<Inicio />} /> */}
      <Route exact path="*"><NoMatch /></Route>
    </Routes>
  );
};

function NoMatch() {
  return (
      <>
          {/* <div className='Header'>
              <center><Header /></center>
          </div> */}
          <section class="page_404">
              <div>
                  <div class="four_zero_four_bg">
                      <h1>404</h1>
                  </div>
                  <div class="box_404">
                      <h3>
                          <center>Pagina No encontrada</center>
                      </h3>
                  </div>
                  <center><button className='boton404'>
                      <NavLink to={{ pathname: `/` }} style={{ textDecoration: 'none', color: '#ffffff' }}>
                          Ir al Men√∫
                      </NavLink>
                  </button></center>
              </div>
          </section>
      </>

  );
}


export default RoutesComponent;
